contracts/AdminManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract AdminManager {
    address public owner;

    constructor() {
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Seul le proprietaire peut effectuer cette action");
        _;
    }

    // Définir les frais de la plateforme
    uint256 public platformFee;

    function setFees(uint256 _fee) external onlyOwner {
        platformFee = _fee;
    }

    // Mapping pour suivre les adresses bannies
    mapping(address => bool) public bannedAddresses;

    function banAddress(address _user) external onlyOwner {
        bannedAddresses[_user] = true;
    }

    function unbanAddress(address _user) external onlyOwner {
        bannedAddresses[_user] = false;
    }

    // Fonction pour donner des actifs gratuitement
    function grantAsset(address _to, address _token, uint256 _amount) external onlyOwner {
        IERC20(_token).transfer(_to, _amount);
    }
}

contracts/AssetManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract AssetManager is Ownable(address(0)) {
    struct Asset {
        string name;
        address tokenAddress;
        uint256 price;
        uint256 volume;
        uint256 tradeCount;
    }

    Asset[] public assets;

    event AssetAdded(uint256 indexed assetId, string name, address tokenAddress, uint256 price);
    event AssetUpdated(uint256 indexed assetId, uint256 price, uint256 volume, uint256 tradeCount);

    function addAsset(string memory name, address tokenAddress, uint256 price) public onlyOwner {
        assets.push(Asset(name, tokenAddress, price, 0, 0));
        emit AssetAdded(assets.length - 1, name, tokenAddress, price);
    }

    function updateAsset(uint256 assetId, uint256 price, uint256 volume, uint256 tradeCount) public onlyOwner {
        require(assetId < assets.length, "Asset ID invalide");
        Asset storage asset = assets[assetId];
        asset.price = price;
        asset.volume = volume;
        asset.tradeCount = tradeCount;
        emit AssetUpdated(assetId, price, volume, tradeCount);
    }

    function getAsset(uint256 assetId) public view returns (Asset memory) {
        require(assetId < assets.length, "Asset ID invalide");
        return assets[assetId];
    }
}

contracts/LiquidityPool.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

contract LiquidityPool is ReentrancyGuard {
    struct PoolInfo {
        address tokenA;
        address tokenB;
        uint256 liquidityTokenA;
        uint256 liquidityTokenB;
    }
    
    mapping(address => mapping(uint256 => PoolInfo)) public userLiquidity;
    PoolInfo[] public pools;
    
    event LiquidityAdded(address indexed user, address tokenA, address tokenB, uint256 amountA, uint256 amountB);
    event LiquidityRemoved(address indexed user, address tokenA, address tokenB, uint256 amountA, uint256 amountB);
    
    function addLiquidity(address tokenA, address tokenB, uint256 amountA, uint256 amountB) public nonReentrant {
        IERC20(tokenA).transferFrom(msg.sender, address(this), amountA);
        IERC20(tokenB).transferFrom(msg.sender, address(this), amountB);
        pools.push(PoolInfo(tokenA, tokenB, amountA, amountB));
        uint256 poolId = pools.length - 1;
        userLiquidity[msg.sender][poolId] = PoolInfo(tokenA, tokenB, amountA, amountB);
        emit LiquidityAdded(msg.sender, tokenA, tokenB, amountA, amountB);
    }

    function removeLiquidity(uint256 poolId) public nonReentrant {
        PoolInfo storage pool = userLiquidity[msg.sender][poolId];
        require(pool.liquidityTokenA > 0 && pool.liquidityTokenB > 0, "Aucune liquidite a retirer");

        IERC20(pool.tokenA).transfer(msg.sender, pool.liquidityTokenA);
        IERC20(pool.tokenB).transfer(msg.sender, pool.liquidityTokenB);
        emit LiquidityRemoved(msg.sender, pool.tokenA, pool.tokenB, pool.liquidityTokenA, pool.liquidityTokenB);

        pool.liquidityTokenA = 0;
        pool.liquidityTokenB = 0;
    }
}

contracts/StackingPool.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

contract StakingPool is ReentrancyGuard, Ownable {
    struct Stake {
        uint256 amount;
        uint256 startTime;
    }

    // Mapping de l'adresse de l'utilisateur à son stake
    mapping(address => mapping(address => Stake)) public userStakes;

    // Événement pour le staking de tokens
    event TokenStaked(address indexed user, address token, uint256 amount);
    
    // Événement pour le retrait de tokens stakés
    event TokenUnstaked(address indexed user, address token, uint256 amount);

    // Constructeur qui initialise le propriétaire
    constructor(address initialOwner) Ownable(initialOwner) {
    }

    // Fonction pour staker des tokens
    function stakeTokens(address token, uint256 amount) public nonReentrant {
        IERC20(token).transferFrom(msg.sender, address(this), amount);
        userStakes[msg.sender][token] = Stake(amount, block.timestamp);
        emit TokenStaked(msg.sender, token, amount);
    }

    // Fonction pour retirer les tokens stakés
    function unstakeTokens(address token) public nonReentrant {
        Stake storage stake = userStakes[msg.sender][token];
        require(block.timestamp > stake.startTime, "Staking period not yet finished");
        uint256 amount = stake.amount;
        require(amount > 0, "No tokens staked");
        
        IERC20(token).transfer(msg.sender, amount);
        emit TokenUnstaked(msg.sender, token, amount);
        
        // Réinitialiser le stake
        stake.amount = 0;
        stake.startTime = 0;
    }
}

contracts/Swap.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract Swap {
    uint256 public swapFee = 100; // 1%
    event TokenSwapped(address indexed user, address fromToken, address toToken, uint256 amount, uint256 receivedAmount);

    function setSwapFee(uint256 _swapFee) public {
        swapFee = _swapFee;
    }

    function tokenSwap(address fromToken, address toToken, uint256 amount, address user) public {
        require(IERC20(fromToken).transferFrom(user, address(this), amount), "Echec du transfert depuis l'utilisateur");

        uint256 feeAmount = (amount * swapFee) / 10000;
        uint256 receivedAmount = amount - feeAmount;

        require(IERC20(toToken).transfer(user, receivedAmount), "Echec du transfert a l'utilisateur");
        emit TokenSwapped(user, fromToken, toToken, amount, receivedAmount);
    }
}

